import styles from './Cards.module.css'

export default function Card(props) {
   // console.log(props )
   return (
      <div className={styles.divCard}>
         <button onClick={props.onClose}>X</button>
         <h2>{props.name}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <img  src={props.image} alt="" />
      </div>
   );
}
